import React from "react";
import SortingVisualizer from "./SortingVisualizer/SortingVisualizer";
import "./App.css";
import NavBar from "./SortingVisualizer/NavBar";

function App() {
  return (
    <div className="App">
      <div>
        <NavBar></NavBar>
      </div>
      <div>
        <SortingVisualizer style="marginTop: 60px"></SortingVisualizer>
      </div>
    </div>
  );
}

export default App;
